					strFormCode += ''+
						'<div class="form-group">'+
						'<label class="control-label">'+oI18n.translations[oI18n.locale].ssi.config.tload+'</label>'+
						'<div class="controls">'+
						'<input title="'+oI18n.translations[oI18n.locale].ssi.config.mload+'" type="file" id="wmessi_cfg_loadfile">'+
						'<ul id="wmessi_cfg_file"></ul>'+
						'<input value="Clear All" type="button" id="wmessi_cfg_clearall">'+
						'<br><em style="color:red;">'+oI18n.translations[oI18n.locale].ssi.config.aload+'</em>';

					strFormCode += ''+
						'</div>'+
						'</div>';

					// -------------------------------
					strFormCode += ''+
						'<div class="form-group">'+
						'<label class="control-label">'+oI18n.translations[oI18n.locale].ssi.config.tother+'</label>'+
						'<div class="controls">' +
						'<label class="control-label" title="'+oI18n.translations[oI18n.locale].ssi.config.mrating+'">'+oI18n.translations[oI18n.locale].ssi.config.trating+'</label>' +
						'<input name="wmessi_cfg_rating" class="form-control" autocomplete="off" value="" id="wmessi_cfg_rating" type="text" size="13">' +
						'</div>' +
						'<div class="controls">'+
						'<input name="wmessi_cfg_callmapcaminfo" value="" id="wmessi_cfg_callmapcaminfo" type="checkbox"><label for="wmessi_cfg_callmapcaminfo" title="'+oI18n.translations[oI18n.locale].ssi.config.mcallmi+'">&nbsp;'+oI18n.translations[oI18n.locale].ssi.config.tcallmi+'</label><br>'+
						'<input name="wmessi_cfg_showage" value="" id="wmessi_cfg_showage" type="checkbox"><label for="wmessi_cfg_showage" title="'+oI18n.translations[oI18n.locale].ssi.config.mage+'">&nbsp;'+oI18n.translations[oI18n.locale].ssi.config.tage+'</label><br>'+
						'<input name="wmessi_cfg_debug" value="" id="wmessi_cfg_debug" type="checkbox"><label for="wmessi_cfg_debug" title="'+oI18n.translations[oI18n.locale].ssi.config.mdebug+'">&nbsp;'+oI18n.translations[oI18n.locale].ssi.config.tdebug+'</label><br>'+
						'</div>'+
						'</div>';


					strFormCode += ''+
						'</form>'+
						'</div>'+
						'';
